import React, { useEffect, useState } from "react";
import { Jumbotron, Container} from "react-bootstrap";
import styles from "../CSS/Category.module.css";
import { useParams } from "react-router-dom";

export default function Category() {
  const { id } = useParams();

  const [category, setCategory] = useState({
    "categoryId": "",
    "name": ""
  })

  useEffect( () => {
      fetch(`http://localhost:8080/categorys`)
        .then((response) => {
          return response.json()
        })
        .then(({categoryId, name}) => {
          setCategory({
            categoryId,
            name
          })
        })
  }, [])

  return (
    <Jumbotron id="about" className={styles.Jumbotron} fluid>
      <Container>
        <div className={styles.card}>
          <h1 className={styles.heading}>
            <span className={styles.Us}>Category</span>
          </h1>
          <Link to={`/products/${product.id}`} key={product.id}>{product.name}</Link>
        </div>
      </Container>
      <div className={styles.lineGrade} ></div>
    </Jumbotron>
  );
}
